import Vue from 'vue'
import App from './App.vue'

// Bootstrap Setup
import 'bootstrap/dist/css/bootstrap.css';  // Bootstrap CSS
import { BootstrapVue, IconsPlugin } from 'bootstrap-vue';  // BootstrapVue
Vue.use(BootstrapVue);
Vue.use(IconsPlugin);

Vue.config.productionTip = false

new Vue({
  render: h => h(App),
}).$mount('#app')
